4mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n"]}],"source":["library(tidyverse)"]},{"cell_type":"markdown","id":"bd228a60","metadata":{"papermill":{"duration":0.011796,"end_time":"2023-02-27T08:27:05.867747","exception":false,"start_time":"2023-02-27T08:27:05.855951","status":"completed"},"tags":[]},"source":["# Variation\n","- Variation is the tendency of the values of a variable to change from measurement to measurement. You can see variation easily in real life; if you measure any continuous variable twice, you will get two different results. This is true even if you measure quantities that are constant, like the speed of light. Each of your measurements will include a small amount of error that varies from measurement to measurement. Categorical variables can also vary if you measure across different subjects (e.g. the eye colors of different people), or at different times (e.g. the energy levels of an electron at different moments). Every variable has its own pattern of variation, which can reveal interesting information. The best way to understand that pattern is to visualize the distribution of the variable’s values."]},{"cell_type":"markdown","id":"316bb68d","metadata":{"papermill":{"duration":0.010813,"end_time":"2023-02-27T08:27:05.889335","exception":false,"start_time":"2023-02-27T08:27:05.878522","status":"completed"},"tags":[]},"source":["##  Visualising distributions\n","- How you visualize the distribution of a variable will depend on whether the variable is categorical or continuous. A variable is categorical if it can only take one of a small set of values. In R, categorical variables are usually saved as factors or character vectors. To examine the distribution of a categorical variable, use a bar chart."]},{"cell_type":"code","execution_count":2,"id":"d1114cd3","metadata":{"execution":{"iopub.execute_input":"2023-02-27T08:27:05.943415Z","iopub.