data":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["# A scatterplot of Old Faithful eruption lengths versus the wait time between eruptions shows a pattern: \n","# longer wait times are associated with longer eruptions. \n","# The scatterplot also displays the two clusters that we noticed above.\n","ggplot(data = faithful) + \n","  geom_point(mapping = aes(x = eruptions, y = waiting))"]},{"cell_type":"markdown","id":"276fc744","metadata":{"papermill":{"duration":0.038222,"end_time":"2023-02-27T08:27:35.166239","exception":false,"start_time":"2023-02-27T08:27:35.128017","status":"completed"},"tags":[]},"source":["- Models are a tool for extracting patterns out of data. For example, consider the diamonds data. It’s hard to understand the relationship between cut and price, because cut and carat, and carat and price are tightly related. It’s possible to use a model to remove the very strong relationship between price and carat so we can explore the subtleties that remain. The following code fits a model that predicts price from carat and then computes the residuals (the difference between the predicted value and the actual value). The residuals give us a view of the price of the diamond, once the effect of carat has been removed."]},{"cell_type":"code","execution_count":37,"id":"2e74c5a8","metadata":{"execution":{"iopub.execute_input":"2023-02-27T08:27:35.24648Z","iopub.status.busy":"2023-02-27T08:27:35.244794Z","iopub.status.idle":"2023-02-27T08:27:38.158125Z","shell.execute_reply":"2023-02-27T08:27:38.124866Z"},"papermill":{"duration":2.957319,"end_time":"2023-02-27T08:27:38.161915","exception":false,"start_time":"2023-02-27T08:27:35.204596","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ1wU194H8JnZBkhRBJQmigXEjliiYsOORsUYDYpdY0mMJSpgbjSJPDHFFhV7\niQ0bds1VAmrsYEdEo4CKiqJ0aVtmnhdzs3fvNkB2d3bH3/dFPnBmdua/QODnOXPOIRmGIQAA\nAADA8l